import React from 'react';
import Slider from 'react-slick';
import slide1 from '../../asets/slide-1.webp';
import slide2 from '../../asets/slide-2.webp';
import slide3 from '../../asets/slide-3.webp';
import 'slick-carousel/slick/slick.css';
import 'slick-carousel/slick/slick-theme.css';
import Banner from '../Banner/Banner';
import './MainSlider.scss';

const MainSlider = ({ homepage }) => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    autoplay: true,
    slidesToShow: 1,
    slidesToScroll: 1,
    prevArrow: null,
    nextArrow: null,
  };

  return (
    <Slider {...settings}>
      {homepage.map((slide, index) => (
        <Banner slide={slide} index={index} />
      ))}
    </Slider>
  );
};

export default MainSlider;
